# Check if there's collision between 2 agents in pairs
def twoAgentCollision(a1_loc,a2_loc,a1_action,a2_action):
    a1_next=(a1_loc[0]+a1_action[0],a1_loc[1]+a1_action[1])
    a2_next=(a2_loc[0]+a2_action[0],a2_loc[1]+a2_action[1])
    if ( a1_next==a2_loc or a1_next==a2_next ) and ( a2_next==a1_loc or a2_next==a1_next ):
        return True
    return False

# Check if my next move induces collision
def noCollisionNextMove(a1_loc,a2_loc,a3_loc,a1_action,a2_action,a3_action):
    a1_next=(a1_loc[0]+a1_action[0],a1_loc[1]+a1_action[1])
    a2_next=(a2_loc[0]+a2_action[0],a2_loc[1]+a2_action[1])
    a3_next=(a3_loc[0]+a3_action[0],a3_loc[1]+a3_action[1])
    if not (a1_next==a2_loc or a1_next==a2_next or a1_next==a3_loc or a1_next==a3_next):
        return True
    return False

# Check if my next position is currently occupied
def freeToMove(a1_loc,a2_loc,a3_loc,a1_action):
    a1_next=(a1_loc[0]+a1_action[0],a1_loc[1]+a1_action[1])
    if not (a1_next==a2_loc or a1_next==a3_loc):
        return True
    return False

# Maps the goal pos to generated action map and the color
def getActionMap(goal):
    if goal[0] == 5 and goal[1] == 5:
        return (smallOrange, "Orange")
    elif goal[0] == 3 and goal[1] == 3:
        return (smallBlue, "Blue")
    elif goal[0] == 3 and goal[1] == 6:
        return (smallRed, "Red")
    elif goal[0] == 9 and goal[1] == 7:
        return (mediumOrange, "Orange")
    elif goal[0] == 5 and goal[1] == 9:
        return (mediumBlue, "Blue")
    elif goal[0] == 8 and goal[1] == 10:
        return (mediumRed, "Red")
    elif goal[0] == 150 and goal[1] == 125:
        return (largeOrange, "Orange")
    elif goal[0] == 100 and goal[1] == 175:
        return (largeBlue, "Blue")
    elif goal[0] == 125 and goal[1] == 140:
        return (largeRed, "Red")
    else:
        return []

class MyAgent(BaseAgent):

    def get_avai_actions(self, game_state):
        avai_actions = []
        for action in action_dict:
            fake_action_profile = dict()
            for name in game_state:
                if name == self.name:
                    fake_action_profile[name] = action
                else:
                    fake_action_profile[name] = 'nil'
            succ_state = self.env.transition(game_state, fake_action_profile)
            if succ_state:
                avai_actions.append(action)
        return avai_actions

    @set_timeout(TIMEOUT, after_timeout)
    def get_action(self, game_state):
        
        # Step 1. figure out what is accessible
        obs = self.observe(game_state)
        avai_actions = self.get_avai_actions(game_state)
        goal = self.env.get_goals()[self.name]
        best_action = 'nil'
        # Step 2. production system or any rule-based system
        
        # TODO: you may want to start here
        # Feel free erase all the demo code above
        other_names = []
        for name in game_state:
            if name == self.name:
                continue
            else:
                other_names.append(name)
                
        other1_name = other_names[0]
        other2_name = other_names[1]
        
        #current locations
        selfloc = obs[0]
        other1_loc = obs[1]
        other2_loc = obs[2]
        
        #next moves
        selfaction = getActionMap(goal)[0][selfloc[0]][selfloc[1]]
        other1_action = getActionMap(self.env.get_goals()[other1_name])[0][other1_loc[0]][other1_loc[1]]
        other2_action= getActionMap(self.env.get_goals()[other2_name])[0][other2_loc[0]][other2_loc[1]]
        
        self_move = action_dict[action_dict_numToString[selfaction]]
        other1_move = action_dict[action_dict_numToString[other1_action]] 
        other2_move = action_dict[action_dict_numToString[other2_action]] 

        #colors
        self_color = getActionMap(goal)[1]
        other1_color = getActionMap(self.env.get_goals()[other1_name])[1]
        other2_color = getActionMap(self.env.get_goals()[other2_name])[1]
        
        # if not hasCollision(selfloc,other1_loc,other2_loc,self_move,other1_move,other2_move):
        #     best_action = action_dict_numToString[selfaction] 

        if noCollisionNextMove(selfloc,other1_loc,other2_loc,self_move,other1_move,other2_move):
            best_action = action_dict_numToString[selfaction] 
        
        if 'nil' in avai_actions:
            avai_actions.remove('nil')
        candidate = random.choice(avai_actions)
        candidate_move = action_dict[candidate]
        if twoAgentCollision(selfloc,other1_loc,self_move,other1_move):
            
            #Check priority between myself and other1
            if priority_dict[self_color] < priority_dict[other1_color]:
                # Choose a random available action for high-priority agent (Move out of the way)
                if freeToMove(selfloc,other1_loc,other2_loc,candidate_move):
                    best_action = candidate
                else:                       
                    best_action = 'nil'  
            else:
                best_action = 'nil'
        if twoAgentCollision(selfloc,other2_loc,self_move,other2_move):
            
            #Check priority between myself and other2
            if priority_dict[self_color] < priority_dict[other2_color]:
                # Choose a random available action for high-priority agent (Move out of the way)
                if freeToMove(selfloc,other1_loc,other2_loc,candidate_move):
                    best_action = candidate
                else:                       
                    best_action = 'nil'  
            else:
                best_action = 'nil'
        
        return best_action
        
        